Sure, I can help you with that. Here is the JSON utility function that computes the cost per kWh of electricity supply and delivery based on the OCR reading:
```javascript
function ComputeCosts(opr) {
  const supplyCost = parseInt(oor.split(':')[1].split(',')[0], 10);
  const deliveryCost = parseInt(oor.split(':')[2].split(',')[0], 10);
  const totalCost = supplyCost + deliveryCost;

  const supplyCostPerKWh = (totalCost / 1000) * 0.01;
  const deliveryCostPerKWh = (totalCost / 1000) * 0.08;

  return { supplyCostPerKWh, deliveryCostPerKWh };
}
```

You can call this function with the `opr` parameter, which is a string that represents the OCR reading from the utility bill, as shown in the previous JSON format. The function uses the parseInt method to convert each number in the OCR reading to an integer, and then it calculates the total cost and the costs per kWh of electricity supply and delivery based on the numbers. Finally, it returns a JSON object with the cost per kWh values for supply and delivery.
